To add labels to associations in PlantUML, you can use the following syntax:

```
[Class1] "label1" [role1] -- "label2" [role2] [Class2]
```

Here's an example:

```
@startuml
class Person {
  name: String
  age: int
}

class Car {
  make: String
  model: String
}

Person "1" -- "0..*" Car : "owns"
@enduml
```

In this example, the association between `Person` and `Car` has the label "owns" and the role names "1" and "0..*" on the respective ends of the association.

You can also use different types of associations, such as aggregation or composition, and add labels to them as well. For example:

```
@startuml
class Department {
  name: String
}

class Employee {
  name: String
  salary: double
}

Department "1" *-- "0..*" Employee : "employs"
@enduml
```

In this case, the association between `Department` and `Employee` is a composition, and the label "employs" is added to the association.

The key points are:

1. Use the `--` symbol to represent an association.
2. Enclose the label in double quotes `"label"`.
3. Optionally, add role names in square brackets `[role]` on each end of the association.

This allows you to clearly communicate the semantics of the relationships between classes in your UML class diagram using PlantUML.
